import pytest
import json
from fastapi import FastAPI
from fastapi.testclient import TestClient
from pytest_httpserver import HTTPServer
from pytest_httpserver.httpserver import Response
from pony.orm import db_session

from polydash.common.db import db
from polydash.common.model import Block
from polydash.polygon.block_retriever.routes import block_router
from polydash.polygon.block_retriever.retriever import (
    BlockRetriever,
    BlockRetrieverSettings,
)


def mock_alchemy_response(request):
    assert request.json
    req_json = request.json

    if req_json["method"] == "eth_getBlockByNumber":
        assert req_json["params"] == ["0x2c895df", True]
        return Response(REAL_BLOCK_JSON)

    if req_json["method"] == "bor_getAuthor":
        assert req_json["params"] == ["0x2c895df"]
        return Response(REAL_AUTHOR_JSON)

    # we don't expect any other method here
    assert False


@pytest.fixture()
def http_client():
    app = FastAPI()
    app.include_router(block_router)
    return TestClient(app=app)


@pytest.fixture()
def mock_db(tmp_path):
    db.bind(provider="sqlite", filename=str(tmp_path / "test.db"), create_db=True)
    db.generate_mapping(create_tables=True)


def test_retrieve_block(mock_db, http_client, httpserver: HTTPServer):
    # we will mock the Alchemy and respond to the expected requests
    httpserver.expect_request("/get_block", method="POST").respond_with_handler(
        mock_alchemy_response
    )

    # retrieve the block
    retriever = BlockRetriever(
        settings=BlockRetrieverSettings(block_rpc_url=httpserver.url_for("/get_block"))
    )
    retriever.process_block(46699999)

    # check the DB to see if the block was inserted correctly
    with db_session:
        retrieved_block = Block.get(number=46699999)
        assert retrieved_block
        assert (
            retrieved_block.hash
            == "0xc686b51f0c1803d99dd1a82de73929ec0004f5a22b11348ee1cdc6097cd20732"
        )
        assert retrieved_block.number == 46699999
        assert retrieved_block.timestamp == 1692887925
        assert len(retrieved_block.transactions) == 70
        assert (
            retrieved_block.validated_by == "0xb2dd091ea6e591d62f565d7a18ce2a7640add227"
        )

    # check the API to see if we can retrieve our block
    response = http_client.get("/block/get_latest")
    assert response.status_code == 200
    json_response = json.loads(response.text)
    assert (
        json_response["hash"]
        == "0xc686b51f0c1803d99dd1a82de73929ec0004f5a22b11348ee1cdc6097cd20732"
    )
    assert json_response["number"] == 46699999
    assert json_response["timestamp"] == 1692887925
    assert len(json_response["transactions"]) == 70
    assert json_response["validated_by"] == "0xb2dd091ea6e591d62f565d7a18ce2a7640add227"


